import Footer from "./components/Footer";
import HomeScreen from "./screens/HomeScreen";


function App() {
  return (
   <Router>
      <Header/>
        <main>
            <Container className="">
            </Container>
        </main>
      <Footer/>
   </Router>
  );
}

export default App;
